import React from "react";
import { ScoreFont } from "./Style";
import { Jumbotron, Button } from "react-bootstrap"

export const HomePage = () => (
  <Jumbotron>
    <ScoreFont>Googly</ScoreFont>
    <p>A game that revolves around the quality of education.</p>
    <Button variant="outline-success" href="https://github.com/JamieJiHeonKim/Googly-Word-Game">GitHub</Button>
  </Jumbotron>
);
